import '../src/App.css';


function App() {

  const clientId = "";
  const [showLoginButton, setShowLoginButton] = useState(true);
  const [ showLogoutButton, setShowLogoutButton] = useState(false);
  const onLoginSuccess = (res) => {
    console.log('Login Success',res.profileObj);
    setShowLoginButton(false);
    setShowLogoutButton(true);
  }
  
  const onFailureSuccess=(res) => {
    console.log('Login Failed:',res);
  }

  const onSignoutSuccess = () => {
    alert("You have been signed out successfully");
    setShowLoginButton(true);
    setShowLogoutButton(false);
  }




  
  return (


    <div className="App">
      <iframe id="topbar"></iframe>
      <h1 id="StudyBuddies">Study Buddies</h1>
      

      {showLoginButton ?
      <GoogleLogin
        clientId={clientId}
        render={renderProps => (
          <button onClick={renderProps.onClick} disabled={renderProps.disabled}>This is my custom Google button</button>
        )}
        buttonText="Login"
        onSuccess={onLoginSuccess} //error here
        onFailure={onFailureSuccess}
        cookiePolicy={'single_host_origin'}
    /> :null
    }

    {showLogoutButton ?
      <GoogleLogout
            clientId={clientId}
            buttonText="Logout"
            onLogoutSuccess={onSignoutSuccess}
          >
      </GoogleLogout> : null
    }



      <button id="signupSmall">Sign up</button>
      <p id="center">We need some kind of tagline here like
          Where students can find study buddies</p>
      <button id="signupBig">Sign up</button>
    </div>


  );
}

export default App;
